script: |
  super -f text -I q6237.spq | sort > q6237.out

inputs:
  - name: q6237.spq
    data: |
      SELECT ALL - ( col0 ) FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col0 IN ( + 73 * + ( - col2 ) * + + col0 * + 31 + + col2 + + ( - col0 ) * - 39 / - 40 );
  - name: tab0

outputs:
  - name: q6237.out
    data: |
      -15
      -87
      -97
